const router = useRouter()
const isPasswordVisible = ref(false)
const isComfirmPasswordVisible = ref(false)
const form = reactive({
  fullName: '',
  email: '',
  password: '', // ‡πÉ‡∏ä‡πâ‡∏Å‡∏±‡∏ö Firebase ‡πÄ‡∏ó‡πà‡∏≤‡∏ô‡∏±‡πâ‡∏ô (‡∏≠‡∏¢‡πà‡∏≤‡∏™‡πà‡∏á‡πÑ‡∏õ backend)
  confirmPassword: '',
  role: 'RESIDENT', // 'RESIDENT' | 'STAFF'
  dormId: null, // number, ‡πÄ‡∏•‡∏∑‡∏≠‡∏Å‡∏à‡∏≤‡∏Å dropdown (‡πÄ‡∏â‡∏û‡∏≤‡∏∞ RESIDENT)
  dormType: 'female dormitory',
  roomNumber: '', // ‡πÄ‡∏â‡∏û‡∏≤‡∏∞ RESIDENT
  position: '' // ‡πÄ‡∏â‡∏û‡∏≤‡∏∞ STAFF
})

const dormList = ref([]) // [{ dormId, dormName }]
// üß† ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡∏Å‡∏£‡∏≠‡∏á‡∏ï‡∏≤‡∏°‡∏õ‡∏£‡∏∞‡πÄ‡∏†‡∏ó dormType ‡∏ó‡∏µ‡πà‡πÄ‡∏•‡∏∑‡∏≠‡∏Å
const filteredDormList = computed(() => {
  if (!form.dormType) return dormList.value
  const type = form.dormType.toLowerCase().includes('female')
    ? 'female'
    : 'male'

  return dormList.value.filter((d) => {
    const name = d.dormName.toLowerCase()
    return name.match(new RegExp(`\\b${type}\\b`)) // match ‡∏Ñ‡∏≥‡πÄ‡∏ï‡πá‡∏°
  })
})

onMounted(async () => {
  try {
    const baseURL = import.meta.env.VITE_BASE_URL
    console.log('Base URL:', baseURL)
    if (!baseURL) throw new Error('VITE_BASE_URL not set')

    const res = await axios.get(`${baseURL}/public/dorms`, {
      headers: { Accept: 'application/json' }
    })

    console.log('API response full:', res)

    // ‡∏ï‡∏£‡∏ß‡∏à‡∏™‡∏≠‡∏ö‡∏ß‡πà‡∏≤‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏≠‡∏¢‡∏π‡πà‡πÉ‡∏ô data ‡∏´‡∏£‡∏∑‡∏≠ data.data
    const dataList = res.data?.data ?? res.data
    console.log('Dorm data after check:', dataList)
    console.log(form.dormType)
    // ‡∏ñ‡πâ‡∏≤‡∏°‡∏±‡∏ô‡∏ß‡πà‡∏≤‡∏á ‡πÉ‡∏´‡πâ‡πÉ‡∏™‡πà fallback ‡πÄ‡∏ú‡∏∑‡πà‡∏≠ dropdown ‡πÑ‡∏°‡πà empty
    if (!Array.isArray(dataList) || dataList.length === 0) {
      console.warn('Dorm list empty, using fallback data')
      dormList.value = [
        { dormId: 1, dormName: 'Dhammaraksa Residence Hall 1' },
        { dormId: 2, dormName: 'Dhammaraksa Residence Hall 2' }
      ]
    } else {
      dormList.value = dataList.map((d) => ({
        dormId: Number(d.dormId),
        dormName: d.dormName
      }))
    }
  } catch (err) {
    console.error('‚ùå Cannot fetch dorm list', err)
    // ‡πÉ‡∏ä‡πâ fallback data
    dormList.value = [
      { dormId: 1, dormName: 'Dhammaraksa Residence Hall 1' },
      { dormId: 2, dormName: 'Dhammaraksa Residence Hall 2' }
    ]
  }
})

const submitForm = async (roleType) => {
  try {
    // ‡πÄ‡∏ä‡πá‡∏Ñ password match
    if (form.password !== form.confirmPassword) {
      isNotMatch.value = true
      setTimeout(() => {
        isNotMatch.value = false
      }, 3000)
      return
    }

    // ‡πÄ‡∏ä‡πá‡∏Ñ fullName ‡∏≠‡∏¢‡πà‡∏≤‡∏á‡∏ô‡πâ‡∏≠‡∏¢ 6 ‡∏ï‡∏±‡∏ß‡∏≠‡∏±‡∏Å‡∏©‡∏£
    if (!form.fullName || form.fullName.trim().length < 6) {
      isFullNameWeak.value = true
      setTimeout(() => {
        isFullNameWeak.value = false
      }, 3000)
      return
    }

    // ‡πÄ‡∏ä‡πá‡∏Ñ password ‡∏≠‡∏¢‡πà‡∏≤‡∏á‡∏ô‡πâ‡∏≠‡∏¢ 6 ‡∏ï‡∏±‡∏ß‡∏≠‡∏±‡∏Å‡∏©‡∏£
    if (!form.password || form.password.length < 6) {
      isPasswordWeak.value = true
      setTimeout(() => {
        isPasswordWeak.value = false
      }, 3000)
      return
    }

    // ‚úÖ ‡πÄ‡∏ä‡πá‡∏Ñ email ‡∏ï‡πâ‡∏≠‡∏á‡πÄ‡∏õ‡πá‡∏ô @gmail.com
    if (!form.email || !form.email.endsWith('@gmail.com')) {
      incorrectemailform.value = true
      setTimeout(() => {
        incorrectemailform.value = false
      }, 3000)
      return
    }

    const [firstName, lastName] = (form.fullName || '').split(' ')
    const roleUpper = String(roleType).toUpperCase()

    const payload =
      roleUpper === 'RESIDENT'
        ? {
            email: form.email,
            firstName,
            lastName,
            role: roleUpper,
            dormId: Number(form.dormId),
            roomNumber: (form.roomNumber || '').trim(),
            password: form.password,
            fullName: form.fullName
          }
        : {
            email: form.email,
            firstName,
            lastName,
            role: roleUpper,
            position: (form.position || '').trim(),
            password: form.password,
            fullName: form.fullName
          }

    // Guard ‡∏ù‡∏±‡πà‡∏á front-end
    if (roleUpper === 'RESIDENT') {
      if (!Number.isFinite(payload.dormId) || payload.dormId <= 0) {
        isNoDorm.value = true
        setTimeout(() => {
          isNoDorm.value = false
        }, 3000)
        return
      }
      if (!payload.roomNumber) {
        isRoomRequired.value = true
        setTimeout(() => {
          isRoomRequired.value = false
        }, 3000)
        return
      }
    } else if (roleUpper === 'STAFF') {
      if (!payload.position) {
        isPositionRequired.value = true
        setTimeout(() => {
          isPositionRequired.value = false
        }, 3000)
        return
      }
    }

    // ‡πÄ‡∏£‡∏µ‡∏¢‡∏Å store
    await registerStore.registerAccount(payload)

    // ‡∏•‡πâ‡∏≤‡∏á‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏´‡∏•‡∏±‡∏á register
    form.password = ''
    form.confirmPassword = ''
    success.value = true
    setTimeout(() => {
      success.value = false
    }, 3000)

    // router.push({ name: 'login' })
  } catch (err) {
    console.error('‚ùå Register error:', err)
    error.value = true
    setTimeout(() => {
      error.value = false
    }, 3000)
  }
}

// ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡∏£‡∏ß‡∏°‡∏™‡∏≥‡∏´‡∏£‡∏±‡∏ö‡∏ï‡∏£‡∏ß‡∏à‡∏Ñ‡∏ß‡∏≤‡∏°‡∏¢‡∏≤‡∏ß input
const checkInputLength = (field) => {
  const MAX_NAME_LENGTH = 30
  const MAX_EMAIL_LENGTH = 30
  const MAX_PASSWORD_LENGTH = 14
  const MAX_STAFFPOSITION_LENGTH = 30
  const MAX_ROMNUMBER_LENGTH = 11
  if (field === 'fullName') {
    const trimmed = form.fullName.trim()
    if (trimmed.length > MAX_NAME_LENGTH) {
      isNameOverLimit.value = true
      form.fullName = trimmed.substring(0, MAX_NAME_LENGTH)
      setTimeout(() => {
        isNameOverLimit.value = false
      }, 1000)
    } else {
      isNameOverLimit.value = false
    }
  } else if (field === 'email') {
    const trimmed = form.email.trim()
    if (trimmed.length > MAX_EMAIL_LENGTH) {
      isEmailOverLimit.value = true
      form.email = trimmed.substring(0, MAX_EMAIL_LENGTH)
      setTimeout(() => {
        isEmailOverLimit.value = false
      }, 1000)
    } else {
      isEmailOverLimit.value = false
    }
  } else if (field === 'position') {
    const trimmed = form.position.trim()
    if (trimmed.length > MAX_STAFFPOSITION_LENGTH) {
      isStaffPositionOverLimit.value = true
      form.position = trimmed.substring(0, MAX_STAFFPOSITION_LENGTH)
      setTimeout(() => {
        isStaffPositionOverLimit.value = false
      }, 1000)
    } else {
      isStaffPositionOverLimit.value = false
    }
  } else if (field === 'password') {
    const trimmed = form.password.trim()
    if (trimmed.length > MAX_PASSWORD_LENGTH) {
      isPasswordOverLimit.value = true
      form.password = trimmed.substring(0, MAX_PASSWORD_LENGTH)
      setTimeout(() => {
        isPasswordOverLimit.value = false
      }, 1000)
    } else {
      isPasswordOverLimit.value = false
    }
  } else if (field === 'confirmPassword') {
    const trimmed = form.confirmPassword.trim()
    if (trimmed.length > MAX_PASSWORD_LENGTH) {
      isConfirmPasswordOverLimit.value = true
      form.confirmPassword = trimmed.substring(0, MAX_PASSWORD_LENGTH)
      setTimeout(() => {
        isConfirmPasswordOverLimit.value = false
      }, 1000)
    } else {
      isConfirmPasswordOverLimit.value = false
    }
  } else if (field === 'roomNumber') {
    const trimmed = form.roomNumber.trim()
    if (trimmed.length > MAX_ROMNUMBER_LENGTH) {
      isRoomNumberOverLimit.value = true
      form.roomNumber = trimmed.substring(0, MAX_ROMNUMBER_LENGTH)
      setTimeout(() => {
        isRoomNumberOverLimit.value = false
      }, 1000)
    } else {
      isRoomNumberOverLimit.value = false
    }
  }
}
