        <h2 class="text-2xl font-bold mb-1">Create your account</h2>
        <p class="text-[#8C8F91] text-sm mb-6">
          Welcome to Tractify ‚Äî Create your account below
        </p>
        <!-- ‚úÖ Popups ‡∏≠‡∏¢‡∏π‡πà‡∏î‡πâ‡∏≤‡∏ô‡∏ö‡∏ô -->

        <!-- <AlertPopUp
          v-if="incorrect"
          :titles="'Username or Password is incorrect.'"
          message="Error!!"
          styleType="red"
          operate="incorrect"
          @closePopUp="closePopUp"
        /> -->
        <AlertPopUp
          v-if="isPasswordNotMatch"
          :titles="'Password is not Match'"
          message="Error!!"
          styleType="red"
          operate="errorpassword"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="error"
          :titles="'There is a problem. Please try again later.'"
          message="Error!!"
          styleType="red"
          operate="problem"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="roomidnotnumber"
          :titles="'Room Number can only type as number.'"
          message="Error!!"
          styleType="red"
          operate="notnumber"
          @closePopUp="closePopUp"
        />
        <!-- Duplicate Email -->
        <AlertPopUp
          v-if="isEmailDuplicate"
          :titles="`This email is already registered`"
          message="Error!!"
          styleType="red"
          operate="email"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="incorrectemailform"
          :titles="'Email Form Is Incorrect'"
          message="Error!!"
          styleType="red"
          operate="emailform"
          @closePopUp="closePopUp"
        />

        <!-- Weak Password -->
        <AlertPopUp
          v-if="isPasswordWeak"
          titles="Password must be at least 6 characters"
          message="Error!!"
          styleType="red"
          operate="password"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="success"
          :titles="'Register New Account is Successfull.'"
          message="Success!!"
          styleType="green"
          operate="success"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="isFullNameWeak"
          :titles="'Full Name must be at least 6 characters.'"
          message="Error!!"
          styleType="red"
          operate="fullname"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="isNoDorm"
          :titles="'Please select a dormitory.'"
          message="Error!!"
          styleType="red"
          operate="dorm"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="isNotMatch"
          :titles="'Passwords do not match'"
          message="Error!!"
          styleType="red"
          operate="notmatch"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="isRoomRequired"
          :titles="'Room number is required.'"
          message="Error!!"
          styleType="red"
          operate="notroomrequired"
          @closePopUp="closePopUp"
        />
        <AlertPopUp
          v-if="isPositionRequired"
          :titles="'Position is required for staff.'"
          message="Error!!"
          styleType="red"
          operate="notpositionrequired"
          @closePopUp="closePopUp"
        />
